  return (
    <div>
      <ul className="Filter_container">
        <div>
          {FilterButton(srcList[0])}
          <p>타입 종류</p>
        </div>
        <div>
          {FilterButton(srcList[1])}
          <p>타입 종류</p>
        </div>

        <FilterButton />
        <FilterButton />
        <FilterButton />
      </ul>
    </div>
  );
}

